Why get/post methods throws Unauthorized (401) ERR?<p>I have a project for log in and sign up, sign up part i used <strong>Express-Validator</strong> in it, while Log in part I'm using <strong>Passport.JS</strong> but, but when i add passport js deceleration in <strong>app.js</strong> it throws Unauthorized error 401.</p>

<p><strong><a href="https://i.stack.imgur.com/3ZcVs.png" rel="nofollow noreferrer">Postman (Body)</a></strong></p>

<p><strong>app.js (Lines that causes the problem)</strong></p>

<blockquote>
  <p>These two lines of code causes this poblem, when i <em>Comment Them</em> it works but in this case i will not able to using <em>Passport.js</em></p>
</blockquote>

<pre><code>//passport
app.use(passport.authorize());
app.use(passport.session()); 
</code></pre>

<p><strong>app.js (All lines of code)</strong></p>

<pre><code>var createError = require('http-errors');
var express = require('express');
var path = require('path');
var cookieParser = require('cookie-parser');
var logger = require('morgan');
const mongoose = require('mongoose');
const session = require('express-session');
const flash = require('connect-flash');
const passport = require('passport');

var indexRouter = require('./routes/index');
var usersRouter = require('./routes/users');

var app = express();

// view engine setup
app.set('views', path.join(__dirname, 'views'));
app.set('view engine', 'hbs');

app.use(logger('dev'));
app.use(express.json());
app.use(express.urlencoded({ extended: false }));
app.use(cookieParser());

//session
app.use(session({
  secret : 'Thisis a big secret :-)',
  saveUninitialized: false,
  resave: false
}));

//flash
app.use(flash())

//passport
app.use(passport.authorize());
app.use(passport.session()); 

app.use(express.static(path.join(__dirname, 'public')));

app.use('/', indexRouter);
app.use('/users', usersRouter);

////////////////////// DB connecting /////////////////////////////
mongoose.connect('mongodb://localhost/product', { useUnifiedTopology: true, useNewUrlParser: true }, (err, res)=&gt;{
  (err)?console.log('ERR While connecting to DB =&gt; ' + err):console.log('DB is connected successfully...');
});
//////////////////////////////////////////////////////////////////

// catch 404 and forward to error handler
app.use(function(req, res, next) {
  next(createError(404));
});

// error handler
app.use(function(err, req, res, next) {
  // set locals, only providing error in development
  res.locals.message = err.message;
  res.locals.error = req.app.get('env') === 'development' ? err : {};

  // render the error page
  res.status(err.status || 500);
  res.render('error');
});

module.exports = app;
</code></pre>

<p><strong>index.js</strong></p>

<pre><code>var express = require('express');
var router = express.Router();
const product = require('../model/product');
const users = require('../model/users');
const { check, validationResult } = require('express-validator');
const passport = require('passport');

/* GET home page. */
router.get('/', function(req, res, next) {
  product.find({}, (err, doc)=&gt;{
    if(err){
      console.log('ERR while searching in DB =&gt;' + err);
    }
      var grid = 3;
      var arr = [];
      for(var i = 0; i&lt;doc.length; i+=grid){
        arr.push(doc.slice(i , i+grid));
      }
      console.log(arr)

    res.render('index', { title: 'Express', product : arr });
  })

});

/* router.post('/', function(req, res, next) {

}); */
//GET login
router.get('/login', (req, res, next)=&gt;{
  res.render('login')

});
router.post('/login', passport.authenticate('local', {
  failureRedirect: '/login',
  successRedirect: '/',
  failureFlash: true,
}));

router.get('/signup', function (req, res, next){
  const msg = req.flash('error')
  res.render('signup', {messages : msg});
});
router.post('/signup',  [
    // password must be at least 5 chars long
    check('password').isLength({ min: 5 }).withMessage('Please enter Password with more than 5 letters!'),
    // username must be an email
    check('username').not().isNumeric().withMessage('please fill username with STRING only'),
    // password must be at least 5 chars long
    check('email').not().isEmpty().withMessage('please fill email with STRING only'),
    check('email').not().isEmail().withMessage('please enter valid email'),
    // password must be at least 5 chars long
    check('password').not().isEmpty().withMessage('Please fill password fie'),
    check('repassword').custom((val, {req})=&gt;{
      if(val !== req.body.password){
        throw new Error('Password is not equal to confirm password');
      }
      return true;
    })
  ],
  function (req, res, next){

    // Finds the validation errors in this request and wraps them in an object with handy functions
    const errors = validationResult(req);
    if (!errors.isEmpty()) {
      var validationMessage = [];
    for(var i = 0; i&lt;errors.errors.length; i++){
      validationMessage.push(errors.errors[i].msg);
    }
    req.flash('error', validationMessage)
      res.redirect('signup')
    }

    const newUser = new users({
      username : req.body.username,
      password : new users().hashPassword(req.body.password)
    });
    users.findOne({username : req.body.username}, (err, doc)=&gt;{
      if(err){
        console.log('ERR while getting username =&gt;' + err);
        return ;
      }
      if(doc){
        console.log('this email is already exist')
      }
    });
    newUser.save((err, doc)=&gt;{
      if(!err){
        console.log('err')
      }else{
        console.log('ERR in saving users =&gt;' + err);
      }
    })
});


module.exports = router;
</code></pre>

