Cannot dump or return relation array inside mongoose object<p>I am trying to learn basic relations with MongoDB and mongoose using Node and Express.</p>

<p><strong>User Model</strong></p>

<pre><code>let mongoose = require("mongoose");

userSchema = mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true,
        unique: true
    },
    password: {
        type: String,
        required: true
    }
});

userSchema.virtual("posts", {
    ref: "Post",
    localField: "_id",
    foreignField: "userId"
});

// Making sure that password field is not present in responses
userSchema.methods.toJSON = function() {
    let user = this.toObject();
    delete user.password;

    // console.log(user.posts);

    return user;
};

// Creating model from schema
User = mongoose.model("User", userSchema);

module.exports = User;
</code></pre>

<p><strong>Post Model</strong></p>

<pre><code>let mongoose = require("mongoose");

postSchema = mongoose.Schema({
    body: {
        type: String,
        required: true
    },
    userId: {
        type: mongoose.Schema.Types.ObjectId,
        required: true,
        ref: "User"
    }
});

let Post = mongoose.model("Post", postSchema);

module.exports = Post;
</code></pre>

<p>These are the two models I am working with. Users have many posts.</p>

<p>Now I know I can get one user by:</p>

<p><code>let user = await User.findOne();</code></p>

<p>And I can populate the posts relation by:</p>

<p><code>await user.populate("posts").execPopulate();</code></p>

<p>But when I <code>console.log(user)</code> or <code>res.send(user)</code>, I only see the user data, I don't see the posts relation data. I can <code>console.log(user.posts)</code> and get the data that way. But why won't it come with the object itself? Is this default behaviour and if it is, how do I get the user object with the posts array in my response?</p>

